import React from 'react';
import './App.css';
import InputField from './components/firstForm/InputField';
import TwoInputFields from './components/SecondForm/TwoInputFields';
import ComplexForm from './components/ThirdForm/ComplexForm';

function App() {
  return (
    <>
      <InputField />
      <br />
      <hr />
      <TwoInputFields />
      <br />
      <hr />
      <ComplexForm />
    </>
  );
}

export default App;
